ody ulicznej ostatnich lat, projektant Gosha Rubichinskiy, na wybiegach prezentując kolekcje marki Fila. W Fila Disruptor 2 chodziły także Emily Ratajkowski czy Dakota Fanning, a w Polsce nosiła je na przykład Marcelina Zawadzka. Właściwie od premiery Fila Disruptor 2 stały się jednym z ulubionych butów influencerek, instagramerek, a także każdej zwracającej uwagę na modę kobiety, która podąża za trendami.Prostota dzięki materiałomCholewka butów wykonana jest z białej skóry oraz materiałów syntetycznych, które nadają obuwiu luksusowego wyglądu, a przy obecnych trendach pasują do wielu damskich stylizacji i codziennego użytku. Zawdzięczamy to barwie buta, uniwersalnemu kolorowi białemu, a także prostej, ale przyciągającej wzrok konstrukcji. Pomimo masywnego wyglądu but jest lekki. Dzięki zastosowanej piance EVA obuwie waży zaledwie 378 gramów. ','','sneakersy-fila','','','','Sneakersy FILA','','','',''),(26,1,1,'Klasyczne sneakersy z nowej kolekcji New Balance przypadną do gustu kobietom ceniącym modne i wygodne dodatki! Granatowa cholewka z przewiewnego materiału została wzmocniona wstawkami z licowej skóry. Miękki język niweluje nacisk klasycznego sznurowania. Tekstylna wyściółka oraz wkładka pozwalają stopie oddychać. Elastyczna podeszwa środkowa lekko amortyzuje, natomiast antypoślizgowy bieżnik odznacza się bardzo dobrą przyczepnością. Lekkie zakrzywienie obuwia pozwala na płynniejszy ruch. Szare logo New Balance podkreśla markę produktu.','','sneakersy-new-balance','','','','Sneakersy NEW BALANCE','','','',''),(27,1,1,'Przyciągające uwagę buty marki New Balance. Lekki wygląd zawdzięczają cholewce: Skóra ekologiczna - Skóra ekologiczna, Materiał - Materiał. Wewnętrzna wyściółka to materiał. Wkładka to materiał. Materiał podeszwy to wysokogatunkowe tworzywo. Buty na co dzień - ponadczasowe i uniwersalne.','','sneakersy-new-balance','','','','Sneakersy NEW BALANCE','','','',''),(28,1,1,'Klasyczna propozycja marki Armani Exchange. Lekki wygląd zawdzięczają cholewce